import React from 'react';
import ReactDOM from 'react-dom';


const Header = (props) => {
  console.log(props)
  return (

    <div>
    <h1>{props.course}</h1>
    </div>
  )
}

const Part = (props) => {
  return(
    <div>
      <p>{props.part} {props.exercises}</p>
    </div>
  )
}

const Content = (props) => {
  return(
    <div>
    <Part part = {props.exercises.part1} exercises={props.exercises.exercises1}></Part>
    <Part part = {props.exercises.part2} exercises={props.exercises.exercises2}></Part>
    <Part part = {props.exercises.part3} exercises={props.exercises.exercises3}></Part>
    </div>
  )
}

const Total = (props) => {
  return (
   <div>
     <p>Number of exercises {props.total.exercises1 + props.total.exercises2 + props.total.exercises3 }</p>
   </div> 
  )
}

const App = () => {
  const course = 'Half Stack application development'
  const part1 = {
    name: 'Fundamentals of React',
    exercises: 10
  }
  const part2 = {
    name: 'Using props to pass data',
    exercises: 7
  }
  const part3 = {
    name: 'State of a component',
    exercises: 14
  }

  return (
    <div>
      <Header course = {course}></Header>
      <Content exercises = {{part1:part1.name, exercises1:part1.exercises, part2:part2.name, exercises2:part2.exercises, part3:part3.name, exercises3: part3.exercises}} />
      <Total total={{exercises1:part1.exercises, exercises2:part2.exercises, exercises3:part3.exercises}} />
    </div>



  )
}

ReactDOM.render(<App />, document.getElementById('root'))
